import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { getTransactionHistory } from "../services/transactionService";
import {
  FiHome,
  FiLogOut,
  FiLayers,
  FiUser,
  FiCompass,
} from "react-icons/fi";

const TransactionHistory = () => {
  const [transactions, setTransactions] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
    } else {
      fetchHistory();
    }
  }, []);

  const fetchHistory = async () => {
    try {
      const data = await getTransactionHistory();
      setTransactions(data);
    } catch (error) {
      console.error("Error fetching transaction history:", error);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-white shadow-lg p-5 flex flex-col">
        <h2 className="text-2xl font-bold text-purple-600 mb-6 flex items-center">
          <FiLayers className="mr-2" /> Virtual Time Bank
        </h2>
        <nav className="flex flex-col space-y-4">
          <button
            onClick={() => navigate("/")}
            className="flex items-center p-3 rounded-lg hover:bg-blue-100 transition"
          >
            <FiHome className="mr-3" /> Home
          </button>
          <button
            onClick={() => navigate("/dashboard")}
            className="flex items-center p-3 rounded-lg hover:bg-blue-100 transition"
          >
            <FiUser className="mr-3" /> Dashboard
          </button>
          <button
            onClick={() => navigate("/explore")}
            className="flex items-center p-3 rounded-lg hover:bg-blue-100 transition"
          >
            <FiCompass className="mr-3" /> Explore
          </button>
          <button
            onClick={() => navigate("/transactions")}
            className="flex items-center p-3 rounded-lg bg-purple-100 text-purple-700"
          >
            ðŸ“œ Transaction History
          </button>
          <button
            onClick={handleLogout}
            className="flex items-center p-3 text-red-600 rounded-lg hover:bg-red-100 transition"
          >
            <FiLogOut className="mr-3" /> Logout
          </button>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Navbar */}
        <div className="bg-white shadow p-4 flex justify-between items-center">
          <h2 className="text-2xl font-semibold text-purple-600">
            Transaction History
          </h2>
        </div>

        {/* Transaction List */}
        <div className="p-6">
          {transactions.length > 0 ? (
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
              {transactions.map((transaction) => (
                <div
                  key={transaction._id}
                  className="bg-white shadow-md p-5 rounded-lg hover:shadow-lg transition"
                >
                  <h4 className="text-lg font-bold text-purple-700">
                    {transaction.skill?.name || "Unknown Skill"}
                  </h4>
                  <p className="text-gray-600 mt-2">
                    {transaction.type === "earn" ? (
                      <span className="text-green-600 font-bold">
                        ðŸŸ¢ Earned
                      </span>
                    ) : (
                      <span className="text-red-600 font-bold">
                        ðŸ”´ Spent
                      </span>
                    )}{" "}
                    {transaction.amount} credits
                  </p>
                  <p className="text-gray-500 text-sm mt-1">
                    {transaction.type === "earn"
                      ? `Earned by: ${
                          transaction.user?.name || "Unknown User"
                        }`
                      : `Spent by: ${
                          transaction.user?.name || "Unknown User"
                        }`}
                  </p>
                  <p className="text-gray-500 text-sm mt-1">
                    Date:{" "}
                    {new Date(transaction.createdAt).toLocaleDateString()}
                  </p>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-500 text-center">
              No transaction history available.
            </p>
          )}
        </div>
      </div>
    </div>
  );
};

export default TransactionHistory;
